function getURLVar(key) {
    var value = [];
    var query = document.location.search.split('?');
    if (query[1]) {
        var part = query[1].split('&');
        for (i = 0; i < part.length; i++) {
            var data = part[i].split('=');
            if (data[0] && data[1]) {
                value[data[0]] = data[1];
            }
        }
        if (value[key]) {
            return value[key];
        }
        else {
            return'';
        }
    }
}

function setLocation(url) {
    document.location.href = url;
}
